const registry = new ethers.Contract('0x9Cb849DB24a5cdeb9604d450183C1D4e6855Fff2', registryAbi, provider);
registry.totalAgents().then(n => console.log('total agents:', n.toString()));
registry.totalAlive().then(n => console.log('total alive:', n.toString()));
registry.getAgent(0).then(a => console.log('agent 0:', a.name, '- heartbeats:', a.heartbeats.toString(), '- streak:', a.currentStreak.toString()));
""}
